import React, { useState } from 'react';
import { Link } from "react-router-dom";

const DoctorLogin = (props)=>{

    const [userName, setUserName] = useState("");
    const [password, setPassword] = useState("");
    
    function onSubmitClick(event){
        event.preventDefault();
        const formData = {
            Email : userName ,
            Password : password
        }

        const save=JSON.stringify(formData);
        localStorage.setItem('DoctorLogin',save);
        console.log(save);
        
        setUserName("");
        setPassword("");
        
    }
    
    
    return(
        <div>
            <p>
                <Link to="/patientlogin">Patient Login Here</Link>
            </p>            
            <h4 className="opacity-75">Doctor Login</h4>
            <form className="col-sm-30" onSubmit={onSubmitClick}>
                <p className="opacity-50">Doctor Email ID</p>
                <input className="form-control" type="Email" placeholder="Enter Email ID" onChange={event => setUserName(event.target.value)}/><br/>
                <p className="opacity-50">Doctor Password</p>
                <input className="form-control" type="password" placeholder="Enter Password" onChange={event => setPassword(event.target.value)}/><br/>
                <div>
                    <button type="Submit" className="btn btn-primary">SUBMIT</button>
                </div>                               
            </form>
            <br/>
            <Link to="/doctorRegistration">New Doctor ? Reg. Here</Link>
                       
        </div>
    );
}

export default DoctorLogin;
